insert  into `issuestatus`(`ID`,`SEQUENCE`,`pname`,`DESCRIPTION`,`ICONURL`,`STATUSCATEGORY`) values ('1','1','Open','The issue is open and ready for the assignee to start work on it.','/images/icons/statuses/open.png','2'),('3','3','In Progress','This issue is being actively worked on at the moment by the assignee.','/images/icons/statuses/inprogress.png','4'),('4','4','Reopened','This issue was once resolved, but the resolution was deemed incorrect. From here issues are either marked assigned or resolved.','/images/icons/statuses/reopened.png','2'),('5','5','Resolved','A resolution has been taken, and it is awaiting verification by reporter. From here issues are either reopened, or are closed.','/images/icons/statuses/resolved.png','3'),('6','6','Closed','The issue is considered finished, the resolution is correct. Issues which are closed can be reopened.','/images/icons/statuses/closed.png','3');

/*Table structure for table `issuetype` */

DROP TABLE IF EXISTS `issuetype`;

CREATE TABLE `issuetype` (
  `ID` varchar(60) NOT NULL,
  `SEQUENCE` decimal(18,0) DEFAULT NULL,
  `pname` varchar(60) DEFAULT NULL,
  `pstyle` varchar(60) DEFAULT NULL,
  `DESCRIPTION` text,
  `ICONURL` varchar(255) DEFAULT NULL,
  `AVATAR` decimal(18,0) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

